import { Route, Routes } from 'react-router-dom';
import ListPage from './ListPage';  // Import the ListPage component

function App() {
  return (
    <Routes>
      <Route path="/" element={<App />} />
      <Route path="/list" element={<ListPage />} /> {/* Add a route for the list page */}
    </Routes>
  );
}
